\begin{align*}
\text{Star} &\subseteq \text{Luminous body} \\
\text{Luminous body} \cap \text{Bright} &\neq \varnothing \\
\therefore\;\; \text{Star} \cap \text{Bright} &\neq \varnothing
\end{align*}
The first line indicates that all stars are luminous bodies. The second line indicates that there exist some luminous bodies that are bright. Using the intersection of sets, we can conclude that there exist some bright stars, which is the final line of the above result.
\begin{align*}
\text{Star} \cap \text{Bright} &= \text{Luminous body} \cap (\text{Bright} \cap \text{Luminous body}) \\
&= \varnothing \cap (\text{Bright} \cap \text{Luminous body}) \text{ (since no star is not luminous)} \\
&= \varnothing \text{ (since no star is both non-luminous and bright)} \\
&\neq \varnothing \text{ (since there exist stars that are bright)} \\
&\therefore\;\; \text{Star} \cap \text{Bright} &= \text{Bright}
\end{align*}
